<script>
export default {
  name: "SvgElement",
  props: ["contagions", "totalcases"],
  mounted() {
    this.setInfections();
    this.clearCantons();
  },
  methods: {
    asyncMethod(key) {
      if (this.contagions.find(x => x.name === key) !== undefined) {
        let cases = `<strong>${
          this.contagions.find(x => x.name === key).cases
        }</strong> cases`;
        let deaths = "";
        const deathsAmount = this.contagions.find(x => x.name === key).deaths;
        if (deathsAmount === 1) {
          deaths = `<br/> <strong>${deathsAmount}</strong> death`;
        } else if (deathsAmount > 1) {
          deaths = `<br/> <strong>${deathsAmount}</strong> deaths`;
        }
        return `${key}: ${cases}${deaths}`;
      } else {
        return `${key}: <strong>0</strong> cases`;
      }
    },
    setInfections() {
      if (document.querySelectorAll(".additional").length) {
        document
          .querySelectorAll(".additional")
          .forEach(e => e.parentNode.removeChild(e));
      }
      const deaths = document.querySelectorAll(".skull");
      deaths.forEach(element => {
        element.remove();
      });
      const circles = document.querySelectorAll("#circles circle");
      circles.forEach(circle => {
        this.setDeath(circle);
        const key = circle.id;
        const values = this.contagions.find(x => x.name === key);
        const pulse = document.querySelector(`.${key}.pulse`);
        if (values) {
          const x = values.cases;
          let c = 0;
          if (x <= 2) {
            c = 4;
          } else if (x > 2 && x <= 6) {
            c = 8;
          } else if (x > 6 && x <= 10) {
            c = 12;
          } else if (x > 10 && x <= 19) {
            c = 17;
          } else if (x > 19 && x <= 25) {
            c = 20;
          } else if (x > 25) {
            c = 25;
          }
          circle.r.baseVal.value = c;
          pulse.r.baseVal.value = c;
        } else {
          circle.r.baseVal.value = 0;
          pulse.r.baseVal.value = 0;
        }
      });
    },
    createNewCircle(x, y, size) {
      // create new circle
      const additionalCircle = document.createElementNS(
        "http://www.w3.org/2000/svg",
        "circle"
      );
      const randomX = Math.floor(Math.random() * size + 5) + 10;
      const randomY = Math.floor(Math.random() * size + 5) + 10;
      additionalCircle.setAttribute("cx", x + randomX);
      additionalCircle.setAttribute("cy", y + randomY);
      additionalCircle.setAttribute("r", "10");
      additionalCircle.setAttribute("fill", "#ef233c");
      additionalCircle.setAttribute("class", "additional");
      document.querySelector("#circles").appendChild(additionalCircle);
      // create new pulse
      const additionalPulse = document.createElementNS(
        "http://www.w3.org/2000/svg",
        "circle"
      );
      additionalPulse.setAttribute("cx", x + randomX);
      additionalPulse.setAttribute("cy", y + randomY);
      additionalPulse.setAttribute("r", "10");
      additionalPulse.setAttribute("fill", "#ef233c");
      additionalPulse.setAttribute("class", "pulse additional");
      document.querySelector("#pulses").appendChild(additionalPulse);
    },
    setDeath(circle) {
      if (this.contagions.find(x => x.name === circle.id) !== undefined) {
        if (this.contagions.find(x => x.name === circle.id).deaths > 0) {
          const deathImg = document.createElementNS(
            "http://www.w3.org/2000/svg",
            "image"
          );
          deathImg.setAttribute("x", circle.cx.baseVal.value - 10);
          deathImg.setAttribute("y", circle.cy.baseVal.value - 10);
          deathImg.setAttribute("width", "20");
          deathImg.setAttribute("height", "20");
          deathImg.setAttribute("href", "skull.png");
          deathImg.setAttribute("class", "skull");
          document.querySelector("#swiss_map").appendChild(deathImg);
        }
      }
    },
    clearCantons() {
      const cantons = document.querySelectorAll("#cantons_paths path");
      cantons.forEach(canton => {
        canton.classList.remove("cleared");
        const key = canton.classList[0];
        const found = this.contagions.find(x => x.name === key);
        if (!found) {
          canton.classList.add("cleared");
        }
      });
    }
  },
  watch: {
    contagions: function() {
      this.setInfections();
      this.clearCantons();
    }
  }
};
</script>

